    // first round of music must be started manually (I don't know why)
    vm.music = new Howl({
        urls: ['assets/sound/music/theme/theme.mp3', 'assets/sound/music/theme/theme.ogg'],
        loop: true,
        volume: .5
    });
    vm.music.play();

